import "../components/home.css";
import Apple from "../Images/apple-card.jpg";
const Itunes = [
  { id: 1, className: "apple-card-1", image: Apple },
  { id: 2, className: "pubg-card-2", image: Apple },
  { id: 3, className: "tiktok-card-3", image: Apple },
  { id: 4, className: "freefire-card-4", image: Apple },
];
export function Home() {
  return (
    <>
      <div className="card-container">
        {Itunes.map((appy) => (
          <div key={appy.id} className={appy.className}>
            <img src={appy.image} alt="appy" />
          </div>
        ))}
      </div>
    </>
  );
}
